import React from 'react';
import { useTheme } from '../hooks/useTheme';

const TestResultPanel = ({ output, isDarkMode }) => {
  const { colors } = useTheme(isDarkMode);

  // Helper function to get status colors
  const getStatusColors = (status) => {
    if (!status) {
      return {
        bg: colors.background.primary,
        text: colors.text.primary
      };
    }

    switch (status) {
      case 'Accepted':
        return {
          bg: colors.status.success.background,
          text: colors.status.success.text
        };
      case 'Wrong Answer':
        return {
          bg: colors.status.error.background,
          text: colors.status.error.text
        };
      default:
        return {
          bg: colors.status.warning.background,
          text: colors.status.warning.text
        };
    }
  };

  if (!output) {
    return (
      <div className="h-full flex items-center justify-center" style={{ backgroundColor: colors.background.secondary }}>
        <p style={{ color: colors.text.secondary }}>Run your code to see the results</p>
      </div>
    );
  }

  // Get status colors only if we have a submission status
  const statusColors = output?.submissionStatus ? getStatusColors(output.submissionStatus) : null;

  return (
    <div className="h-full flex flex-col" style={{ backgroundColor: colors.background.secondary }}>
      {/* Results Header */}
      <div className="flex items-center p-2" style={{ 
        backgroundColor: colors.background.primary,
        borderBottom: `1px solid ${colors.border.primary}`
      }}>
        <h2 className="text-sm font-medium" style={{ color: colors.text.primary }}>
          {output?.isSubmission ? 'Submission Results' : 'Test Results'}
        </h2>
      </div>

      {/* Results Content */}
      <div className="flex-1 p-4 overflow-y-auto">
        {output.error ? (
          <div className="space-y-4">
            <div className="p-3 rounded" style={{ 
              backgroundColor: colors.status.error.background,
              color: colors.status.error.text 
            }}>
              <div className="font-semibold">Error:</div>
              <div className="whitespace-pre-wrap">{output.error}</div>
              {output.details && (
                <div className="mt-2 text-sm opacity-75 whitespace-pre-wrap">
                  {output.details}
                </div>
              )}
            </div>
          </div>
        ) : (
          <div className="space-y-4">
            {/* Submission Status */}
            {output.submissionStatus && statusColors && (
              <div className="p-3 rounded" style={{
                backgroundColor: statusColors.bg,
                color: statusColors.text
              }}>
                <div className="font-semibold text-lg mb-2">
                  {output.submissionStatus}
                </div>
                <div className="grid grid-cols-2 gap-4">
                  {output.runtime && (
                    <div className="text-sm">
                      Runtime: {output.runtime}
                    </div>
                  )}
                  {output.memory && (
                    <div className="text-sm">
                      Memory: {output.memory}
                    </div>
                  )}
                </div>
              </div>
            )}

            {/* Test Results */}
            {output.testResults && output.testResults.length > 0 && (
              <div className="space-y-4">
                {/* Test Cases Summary */}
                <div className="p-3 rounded" style={{
                  backgroundColor: colors.background.primary,
                  border: `1px solid ${colors.border.secondary}`
                }}>
                  <div className="font-medium mb-2" style={{ color: colors.text.primary }}>
                    Test Cases Summary
                  </div>
                  <div className="grid grid-cols-2 gap-2 text-sm">
                    <div style={{ color: colors.text.secondary }}>
                      Total Cases: {output.testResults.length}
                    </div>
                    <div style={{ color: colors.status.success.text }}>
                      Passed: {output.testResults.filter(r => r.passed).length}
                    </div>
                  </div>
                </div>

                {/* Individual Test Cases */}
                {output.testResults.map((result, index) => (
                  <div key={index} className="space-y-2">
                    <div className="flex items-center justify-between p-2 rounded" style={{
                      backgroundColor: colors.background.primary,
                      borderLeft: `4px solid ${result.passed ? colors.status.success.text : colors.status.error.text}`
                    }}>
                      <div className="font-medium" style={{ color: colors.text.primary }}>
                        Test Case {index + 1}
                      </div>
                      <span className="text-sm font-medium px-2 py-1 rounded" style={{ 
                        backgroundColor: result.passed ? colors.status.success.background : colors.status.error.background,
                        color: result.passed ? colors.status.success.text : colors.status.error.text 
                      }}>
                        {result.passed ? 'Passed' : 'Failed'}
                      </span>
                    </div>
                    <div className="space-y-2 ml-4">
                      <div className="p-3 rounded" style={{ 
                        backgroundColor: colors.background.primary,
                        color: colors.text.primary,
                        border: `1px solid ${colors.border.secondary}`
                      }}>
                        <div className="text-sm" style={{ color: colors.text.secondary }}>
                          <div className="mb-1">Input:</div>
                          <pre className="whitespace-pre-wrap font-mono">{result.input}</pre>
                        </div>
                      </div>
                      <div className="p-3 rounded" style={{ 
                        backgroundColor: colors.background.primary,
                        color: colors.text.primary,
                        border: `1px solid ${colors.border.secondary}`
                      }}>
                        <div className="text-sm" style={{ color: colors.text.secondary }}>
                          <div className="mb-1">Expected Output:</div>
                          <pre className="whitespace-pre-wrap font-mono">{result.expectedOutput}</pre>
                        </div>
                      </div>
                      <div className="p-3 rounded" style={{ 
                        backgroundColor: colors.background.primary,
                        color: colors.text.primary,
                        border: `1px solid ${colors.border.secondary}`
                      }}>
                        <div className="text-sm" style={{ color: colors.text.secondary }}>
                          <div className="mb-1">Actual Output:</div>
                          <pre className="whitespace-pre-wrap font-mono">{result.actualOutput}</pre>
                        </div>
                      </div>
                    </div>
                  </div>
                ))}
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

export default TestResultPanel;
